import React from 'react';
import {render} from 'react-dom';
import Comment from "./Comment";
import {image} from "faker";


const App = () => {
    return (
        <div className="ui container comments">
            <Comment name="Mila" text="Great Content!" avatar={image.avatar()}/>
            <Comment name="Alex" text="Interesting" avatar={image.avatar()}/>
            <Comment name="Tom" text="Like it" avatar={image.avatar()}/>
        </div>
    )};

render(<App />, document.getElementById('root'));
